erty name=\"testOnReturn\" value=\"false\"/>\n                      <property name=\"poolPreparedStatements\" value=\"true\"/>\n                      <property name=\"maxPoolPreparedStatementPerConnectionSize\" value=\"20\"/>\n                      <property name=\"connectionProperties\" value=\"druid.stat.mergeSql=true;druid.stat.slowSqlMillis=500\"/>\n                  </datasource>\n              </datasources>\n          </configurations>', '影子库配置模板', 0, '2022-08-22 07:14:06', '2022-08-22 07:14:06', -1, 'system');
